USED; aprx 300 rounds through the rifle, no wear, looks new
Bell & Carlson Tactical Medalist Style 5 Fully Adjustable - Remington 700 S/A
Color: Olive Drab with Black Web
THIS UNIT FITS HEAVY BARREL BDL/SPS Rifles
- Barrel channel can be easily opened to mil spec/ full bull;
- Quality Bell & Carlson Lay-up Fiberglass / Aluminum Construction;
- Length of pull 13.5" to 15.5". It's 12.5" with the buttpad removed;
- About 2" in comb adjustment;
- Weight: 5 lbs.
- Length: 31"

3-way adjustable butt assembly that adjusts for: length of pull; cant (left/right butt tilt); and height (up/down); adjustable cheek piece for precise cheek/eye placement to scope; Wide & Flat forend for bench / bag stability; Anschutz-style forend rail (attaches accessories such as bipods, grips, etc.)
